import React, { Component } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import pont from '../styles/font.css';

class Navigation extends Component {

  
    render() {
      return (
        <Nav>
            <NavList>
            <NavItem><Link to='/about' style={{ textDecoration: 'none',color:'balck'}}>소개</Link></NavItem>
                <NavItem><Link to='/board' style={{ textDecoration: 'none',color:'balck'}}>프로젝트</Link></NavItem>
                <NavItem><Link to='/myboard' style={{ textDecoration: 'none' ,color:'black'  }}>내 글보기</Link></NavItem>
                <NavItem><Link to='/mypage' style={{ textDecoration: 'none' ,color:'black'}}>마이페이지</Link></NavItem>
                <NavItem><Link to='/comment' style={{ textDecoration: 'none' ,color:'black' }}>방명록</Link></NavItem>
            </NavList>
        </Nav>
      );
    }
  }
  
export default Navigation;

const Nav = styled.div`
    width: 100%;
    height: 40px;
    border-top: none;
    border-bottom: 0.5px solid white;
   
`

const NavList = styled.ul`
    width: 1080px;
    display: flex;
    margin: 0 auto;
    position:absolute;
        right:-620px;
    
`

const NavItem = styled.li`
    width: 100px;
    
    margin-top:1px;
    display: flex;
    color: black;
`
